import React from "react";
import styled from "styled-components";
import { withRouter } from "react-router";
import { Link } from "react-router-dom";

const Header = (props) => {
  console.log(props);
  return (
    <React.Fragment>
      <Title>Gaesi-pan</Title>

      <Buttonset>
        <Link to="/">
          <button
            style={{ width: 200, height: 40 }}
            onClick={() => {
              props.history.push("/");
            }}
          >
            모든 포스팅
          </button>
        </Link>
        <Link to="/write">
          <button
            style={{ width: 300, height: 40, margin: 20 }}
            // onClick={() => {
            //   props.history.push("/write");
            // }}
          >
            글쓰기
          </button>
        </Link>
        <Link to="/intro">
          <button
            style={{ width: 200, height: 40 }}
            onClick={() => {
              props.history.push("/intro");
            }}
          >
            소개
          </button>
        </Link>
      </Buttonset>

      <hr style={{ width: 1200 }} />
    </React.Fragment>
  );
};

const Title = styled.h1`
  text-align: center;
  font-size: 60px;
  margin: 50px auto;
`;

const Buttonset = styled.div`
  text-align: center;
  margin: 0 auto;
`;
export default withRouter(Header);
